import '../css/text-info.css';


function TextInfo( {mainText, secText, buttonText} ) {
  return (
    <div className="TextInfo">
        <p className='texto-principal'>
          <strong>{mainText}</strong>
        </p>
        <p className='texto-secundario'>
          {secText}
        </p>
    </div>   
  );
}

export default TextInfo;
